import axios from "axios";

class TempClass {
  //   constructor(props) {
  //     // super(props);
  //     this.props = {
  //       id: "",
  //       title: "",
  //       contents: "",
  //       email: "",
  //       read_cnt: "",
  //     };
  //   }

  componentDidMount() {
    axios.get("http://localhost:8080/feedback").then((response) => {
      console.log(response.data);
    });
  }

  render() {
    this.componentDidMount();
  }
}

export default TempClass;

const p1 = new TempClass();
